                onChangeText={(text) => this.setState({ username: text })}
                value={this.state.username}
              />
            </Item>
            <Item>
              <Input
                placeholder="Senha"
                secureTextEntry={true}
                onChangeText={(text) => this.setState({ password: text })}
                value={this.state.password}
